import Navbar from "../components/Navbar";
import logo from "../image/yinEtYang.png";
import { Link} from "react-router-dom";
import "./Home.css";

function Home() {
  return (
    <div className="Home bg-gray-200 h-screen">
      <Navbar/>
      <div className=" bg-gray-200 h-screen ">
        <div className="flex flex-wrap">
          <img
              className="w-96 absolute top-0 left-0"
              src={logo}
              alt="Logo"
          />
          <h1 className="text-base absolute right-0">𝓛𝓮 𝓳𝓪𝓻𝓭𝓲𝓷 𝓭𝓮𝓼 𝓶𝓸𝓽𝓼</h1>
        </div>

        <div className="flex flex-wrap mt-32">
          <img
          className="w-96 absolute right-0"
          src={logo}
          alt="Logo"
          />
          <h1 className="text-base absolute left-0">𝓛𝓮 𝓳𝓪𝓻𝓭𝓲𝓷 𝓭𝓮𝓼 𝓶𝓸𝓽𝓼</h1>
        </div>

        {/* <div className="flex flex-wrap">
          <img
          className="w-96 mt-96 absolute left-0"
          src={logo}
          alt="Logo"
          />
          <h1 className="text-base absolute right-0">𝓛𝓮 𝓳𝓪𝓻𝓭𝓲𝓷 𝓭𝓮𝓼 𝓶𝓸𝓽𝓼</h1>
        </div> */}

      </div>
    </div>
  );
}

export default Home;
